/**
 * Asynchronously run code.
 *
 * @param {import('vfile').VFile} file JS document to run
 * @param {unknown} options
 * @return {Promise<*>}
 */
export function run(file: import('vfile').VFile, options: unknown): Promise<any>;
/**
 * Synchronously run code.
 *
 * @param {import('vfile').VFile} file JS document to run
 * @param {unknown} options
 * @return {*}
 */
export function runSync(file: import('vfile').VFile, options: unknown): any;
